import React, { useEffect, useState } from "react";

import SignleReport from "./SingleReport";


function Reports() {
    const [reports, setReports] = useState([{
        state: '',
        type: '',
        message: ''
    }]);

    useEffect(() => {
        fetch("/reports")
            .then(res => {
                if (res.ok) {
                    console.log(res)
                    return res.json()
                }
            }).then(jsonRes =>
                setReports(jsonRes));
    }, [])

    return <div className="container">
        <h1 className="display-3">Report Page</h1>
        {reports.map(rep => (
            <SignleReport key={rep.key} state={rep.state} type={rep.type} message={rep.message} />
        ))}
    </div>
}

export default Reports;
